import React, { useState } from 'react'
import OtpInput from 'react-otp-input';

const Otp = () => {
    const [otp,setOtp]=useState<string>()
  return (
     <div>
        <h1>Enter Otp</h1>
     <OtpInput
      value={otp}
      onChange={setOtp}
      numInputs={4}
      renderSeparator={<span>-</span>}
      renderInput={(props) => <input {...props} />}
    />
     </div>
  )
}

export default Otp
